import React from "react";
import { NavLink } from "react-router-dom";
import img1 from "./img1.svg";

const Home = () => {
    return (
        <>
            <section className="d-flex align-items-center">
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-10 mx-auto"> {/* using 10 columns instead of 12 */}
                            <div className="row">
                                <div className="col-md-6 pt-5">
                                    <h2 className="fw-semibold">Grow your business with <strong className="tech">TechnicalTalks</strong></h2>
                                    <h6 className="my-3 text-secondary">We are team of talented developers making websites</h6>
                                    <div className="mt-3">
                                        <NavLink className="btn rounded-5 shadow text-info" to="/">Get Started</NavLink>
                                    </div>
                                </div>
                                <div className="col-md-6">
                                    <img src={img1} className="img-fluid" alt="home" />
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Home;
